import React from "react";
import Cardlist from "./Cardlist";
import SearchBox from "./SearchBox";
import { robots } from "./robotList";

const App = () => {
  return (
    <div>
      <h1>Header</h1>
      <SearchBox />
      <Cardlist robot={robots} />;
    </div>
  );
};

export default App;
